import { useState } from "react";

const App = () => {
  const [onScroll, setOnScroll] = useState(false)

  return (
    <>
     <nav>
     
       <div className={onScroll ? "mane scroll" : "menu"}>
         <ul >
           <li>home</li>
           <li>about</li>
           <li>services</li>
           <li>contact us</li>
         </ul>
       </div>
     </nav>
    </>
  );
}

export default App;
